CREATE TABLE `recipes` (
  `id` int(11) NOT NULL,
  `name` varchar(50) DEFAULT NULL,
  `description` varchar(1000) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

INSERT INTO `recipes` (`id`, `name`, `description`) VALUES
(1, 'crepes', 'pour 4 personnes tu connais'),
(2, 'lasagnes', 'pour 6 personnes\r\ncouper et cuire les oignons, les faire mijoter avec la polpa, cuire la viande hachée et l\'ajouter au mijotage\r\nbéchamel : fondre le beurre, ajouter la farine hors du feu, ajouter le lait, chauffer jusqu\'à épaississement\r\nbeurrer le plat\r\ndisposer : béchamel, pates de lasagne, viande, fromage\r\nfinir par béchamel et fromage au dessus\r\n45min à 165°C'),
(3, 'pancakes', 'pour 4 personnes\r\nc\'est globalement comme les crêpes\r\nau moment d\'ajouter les œufs, garder les blancs à part, mettre le beurre fondu avant d\'ajouter la farine, monter les blancs et les incorporer délicatement avec une marise ');


